import React from 'react';
import { Grid, Segment, Image, Icon, Divider } from 'semantic-ui-react'
import tmdb from '../Static/Images/tmdb.jpg'
import indra from '../Static/Images/indra.jpg'

const Footer = () => {

    return (
        <Segment padded='very'>
            <div>
                <Divider/>
                <Segment textAlign="center">
                    <Icon name="linkedin" style={{ fontSize: "20px" }} color="teal" />
                    <Icon name="instagram" style={{ fontSize: "20px" }} color="pink" />
                    <Icon name="facebook f" style={{ fontSize: "20px" }} color="blue" />
                    <Icon name="github" style={{ fontSize: "20px" }} color="grey" />
                </Segment>
            </div>
        </Segment>
    )
}

export default Footer;
